import React from 'react';
import {
  Button,
  Container,
  Row,
  Col,
  Navbar,
  Nav,
  Form,
  FormControl,
} from 'react-bootstrap';

const HeaderPokemon = props => {
  return (
    <div className='HeaderPokemon'>
      <Container fluid>
        <Navbar bg="dark" variant="dark" expand="lg">
          <Navbar.Brand href="#">Pokemon </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#">GitHub</Nav.Link>
              <Nav.Link href="#">Linkedin</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </Container>
    </div >
  )
}

const CampoPesquisa = props => {
  return (
    <div className='CampoPesquisa'> </div>
  )
}

const BodyPokemon = props => {
  return (
    <div className='BodyPokemon'> </div>
  )
}

function App() {
  return (
    <div className='App'>
      <HeaderPokemon />
      <CampoPesquisa />
      <BodyPokemon />
    </div>
  )
}

export default App
